import React from 'react';
import './index.css';

function SideBar() {
  return (
    <div className='sidebar'>
      <h2>Manage</h2>
      <div className='sidebarItem'>
        <div className='scrbar' />
        <div className='barItem'>
          <h4 className='normal'>Sessions</h4>
          <h4>Threshold Sets</h4>
          <h4>Questionnaire</h4>
          <h4>AI Model</h4>
        </div>
      </div>
    </div>
  );
}

export default SideBar;
